import './App.css';

function App() {
  const cowok = ["joan", "aditya", "agrieva"]
  const cewek = ["dian", "bunga", "lucinta luna"]
  const guru = {
    usia: 30,
    galak: true,
  }
  const gabungan2 = [...cowok, ...cewek, {...guru}]

  gabungan2.map((result, index) => {
    console.log("result :", result);
  })

  console.log("cowok = ",cowok)
  console.log("cewek = ",cewek)
  console.log("guru = ", guru)
  console.log("gabungan2 = ",gabungan2)

  return (
    <div className="App">
      <div className='cowok'>
      <h5>COWOK 1 = {cowok[0]}</h5>
      <h5>COWOK 2 = {cowok[1]}</h5>
      <h5>COWOK 3 = {cowok[2]}</h5>        
      </div>
      <div className='cewek'>
      <h5>CEWEK 1 = {cewek[0]}</h5>
      <h5>CEWEK 2 = {cewek[1]}</h5>
      <h5>CEWEK 3 = {cewek[2]}</h5>        
      </div>
    </div>
  );
}

export default App;
